<template>
	<el-dialog
		close="dialog"
		:visible.sync="show"
		:fullscreen="true"
		:close-on-click-modal="false"
		:show-close="false"
	>
		<div class="full-dialog-header">
			<div style="display: flex">
				<el-upload
					class="upload-demo mr-10"
					action="#"
					:before-upload="handleBeforeUpload1"
					:show-file-list="false"
				>
					<el-button icon="el-icon-upload2">上传pdf文件</el-button>
				</el-upload>
				<template v-if="signOrSeal == 'seal'">
					<el-upload
						class="avatar-uploader mr-10"
						action="#"
						:before-upload="handleBeforeUpload"
						multiple
						:limit="1"
						:show-file-list="false"
					>
						<el-button icon="el-icon-upload2">上传印章</el-button>
					</el-upload>
					<el-button
						:disabled="submitabl"
						class="mr-10"
						icon="el-icon-coordinate"
						@click="seal('')"
						>盖章</el-button
					>
				</template>
				<el-button
					:disabled="submitabl"
					v-if="signOrSeal == 'sign'"
					class="mr-10"
					icon="el-icon-edit-outline"
					@click="sign"
					>签名</el-button
				>
				<el-button
					v-loading="loading"
					icon="el-icon-download"
					@click="savePdf"
					>下载</el-button
				>
				<!-- <el-button class="mr-1" icon="el-icon-printer" @click="print">打印</el-button> -->
			</div>
			<el-button @click="show = false">取消</el-button>
		</div>
		<div id="print" style="height: 100%">
			<div>
				<SignImg
					v-if="signImgShow"
					:showFunction="showFunction"
					:signImgUrl="signImgUrl"
					:signImgBase64="signImgBase64"
					:signSuccess="signSuccess"
				></SignImg>
			</div>
			<div ref="pdfViewer" style="height: 95%">
				<div id="preViewPdf"></div>
			</div>
		</div>
	</el-dialog>
</template>
<script>
import Pdfh5 from "pdfh5";
import "pdfh5/css/pdfh5.css";
import DragImg from "./DragImg";
import SignImg from "./SignImg";
import Vue from "vue";
import printStyle from "./printStyle";
import JsPDF from "jspdf";
import html2canvas from "html2canvas";

export default {
	name: "Signature-vue",
	components: { SignImg },
	data() {
		return {
			loading: false,
			show: false,
			submitabl: false,
			showSubmit: true,
			signOrSeal: "sign",
			signImgBase64: "",
			signImgShow: false,
			sealImgCount: 0,
			sealImgReuseCount: 0,
			signImgUrl: null,
			isPdfShow: false,
			preViewPdfID: "preViewPdf",
			url: "data:image/png;base64,",
			photoSize: {},
		};
	},
	mounted() {
		if (this.pdfh5) {
			this.pdfh5.on("complete", (status, msg, time) => {
				console.log(status, msg, time);
				if (status !== "success") {
					console.log("-------------");
				}
			});
		}
	},
	methods: {
		print() {
			let print = this.$refs.pdfViewer.innerHTML;
			let printPart = print + printStyle;
			let newTab = window.open("_blank");
			newTab.document.body.innerHTML = printPart;
			newTab.print();
			newTab.close();
		},
		handleExceed(file, fileList) {
			var type = file.type.substring(0, file.type.lastIndexOf("/"));
			if (type !== "image") {
				this.$message.error("只支持上传图片!");
			}
			const isLt2M = file.size / 1024 / 1024 < 2;
			if (!isLt2M) {
				this.$message.error("上传的图片大小不能超过 2MB!");
			}
			this.$message.warning(
				`当前限制选择 1 个文件，本次选择了 1 个文件，共选择了 2 个文件`
			);
		},
		handleBeforeUpload1(file) {
			var type = file.type.substring(
				file.type.lastIndexOf("/") + 1,
				file.type.length
			);
			if (type !== "pdf" && type !== "PDF") {
				this.$message.error("请上传pdf类型文件!");
				return;
			}
			const isLt2M = file.size / 1024 / 1024 < 10;
			if (!isLt2M) {
				this.$message.error("上传的文件大小不能超过 10MB!");
				return;
			}
			this.submitabl = false;
			return new Promise((resolve, reject) => {
				const reader = new FileReader();
				reader.readAsDataURL(file);
				this.isPdfShow = false;
				reader.onload = () => {
					// 将 base64 数据保存到上传数据中
					this.url = reader.result;
					resolve(file);
					// this.preViewPdf = 'preViewPdf'+ new Date().getTime()
					this.$message.success("上传成功");
					this.init();
				};
				reader.onerror = (error) => {
					this.isPdfShow = true;
					this.$message.warning("上传失败");
					reject(error);
				};
			});
		},
		handleBeforeUpload(file) {
			var type = file.type.substring(0, file.type.lastIndexOf("/"));
			if (type !== "image") {
				this.$message.error("只支持上传图片!");
				return;
			}
			const isLt2M = file.size / 1024 / 1024 < 2;
			if (!isLt2M) {
				this.$message.error("上传的图片大小不能超过 2MB!");
				return;
			}
			this.deleteDragImg(true);
			this.submitabl = false;
			const that = this;
			return new Promise((resolve, reject) => {
				const reader = new FileReader();
				reader.readAsDataURL(file);
				reader.onload = () => {
					// 将 base64 数据保存到上传数据中
					this.signImgBase64 = reader.result;
					// console.log(this.signImgBase64);
					resolve(file);
					this.$message.success("上传成功");
					let img = new Image();
					img.src = reader.result;
					img.onload = function () {
						//注意只有onload以后才可以拿到图片信息
						// console.log({
						// 	width: img.width,
						// 	height: img.height,
						// });
						that.photoSize = {
							width: +img.width,
							height: +img.height,
						};
						console.log(
							"img.onload => that.photoSize",
							that.photoSize
						);
						resolve({
							width: img.width,
							height: img.height,
						});
					};
				};
				reader.onerror = (error) => {
					this.$message.warning("上传失败");
					reject(error);
				};
			});
		},
		init(signOrSeal) {
			signOrSeal ? (this.signOrSeal = signOrSeal) : "";
			this.show = true;
			this.submitabl = false;
			// this.isPdfShow = true https://github.com/Stormzhouyuheng/myui.git
			this.$nextTick(() => {
				this.openPdf(this.url);
			});
		},
		/** 关闭窗口操作 */
		closeDialog() {
			this.show = false;
			// this.$emit('update:show', false);
		},
		//签名框方法
		showFunction() {
			this.signImgShow = this.signImgShow ? false : true;
		},
		signSuccess(imgData, isReuse) {
			// console.log(imgData);
			this.massage = "请调整位置和大小后提交";
			this.signImgShow = this.signImgShow ? false : true;
			this.seal(imgData, "sign", isReuse);
		},
		//签名框方法end
		openPdf(url) {
			this.visible = true;
			this.pdfh5 = new Pdfh5("#preViewPdf", {
				pdfurl: url,
				maxZoom: 1,
				// lazy:true,
				// scrollEnable:true
			});
		},
		sign() {
			this.signImgShow = true;
		},
		undo() {
			this.pdfh5.options.backTop = false;
		},
		//删除图片
		deleteDragImg(isReuse) {
			this.sealImgCount--;
			if (isReuse) {
				this.sealImgReuseCount--;
			}
			if (this.sealImgCount === 0) {
				this.submitabl = false;
			}
		},
		seal(imgData, type, isReuse) {
			this.submitabl = true;
			let scrollt =
				document.querySelector(".pdfViewer").parentElement.parentElement
					.scrollTop;
			var dragImg = Vue.extend(DragImg);
			const app = new dragImg({
				propsData: {
					deleteDragImg: this.deleteDragImg,
					imgData: imgData || this.signImgBase64,
					isReuse: isReuse,
					top: scrollt,
					photoSize: this.photoSize,
					// currentPageNum:this.pdfh5.currentNum,
					// currentPageNum: this.pdfh5.pageNow[0].innerText,
					imgType: type,
				},
				ref: "a",
			}).$mount(document.createElement("div"));
			this.sealImgCount++;
			if (isReuse) {
				this.sealImgReuseCount++;
			}
			let currentNum = parseInt(this.pdfh5.pageNow[0].innerText);
			this.pdfh5.pages[this.pdfh5.currentNum - 1].appendChild(app.$el);
			this.pdfh5.pages[currentNum - 1].appendChild(app.$el);
			document.querySelector(".pdfViewer").appendChild(app.$el);
		},
		savePdf() {
			//隐藏图片操作按钮
			// var imgBtn = document.getElementsByClassName('imgBtn');
			// if (imgBtn) {
			//   for (let i = 0; i < imgBtn.length; i++) {
			//     imgBtn[i].style.display = "none";
			//   }
			// }
			//隐藏签名盖章按钮
			// this.signOrSeal = '';
			// this.showSubmit = false;
			//提交
			// this.loading = true;
			setTimeout(() => {
				this.$nextTick(() => {
					this.setSign();
				});
			}, 500);
		},
		// 将签名或印章放到对应页面中
		setSign() {
			let parentElement =
				document.querySelector(".pdfViewer").children || [];
			// console.log(
			// 	'document.querySelector(".pdfViewer")',
			// 	document.querySelector(".pdfViewer")
			// );
			// console.log(
			// 	'document.querySelector(".pdfViewer").children',
			// 	document.querySelector(".pdfViewer").children
			// );
			let result = Array.from(parentElement).filter(function (child) {
				return child.className === "dragImg";
			});
			// console.log('result', result);
			let baseNum = 1263.85;
			let length = result.length; // 获取pdf页数
			let promiseArr = [];
			// 循环页面
			for (let i = 0; i < length; i++) {
				this.$nextTick(() => {
					// 页面中有样式名为dragImg的,代表该页面有签名或者签章
					// 有签名或签章就绘制页面
					if (result[i].className == "dragImg") {
						let promise = "";
						promise = new Promise((resolve, reject) => {
							let html = result[i];
							let ele = html.querySelector("#pic");
							let eleImg = html.querySelector("#pic div");
							console.log(html, ele, ele.style.top);
							let top = ele.style.top
								? ele.style.top.split("px")[0] - 0
								: 0;
							let topImg = eleImg.style.top
								? eleImg.style.top.split("px")[0] - 0
								: 0;
							let currentTop = top + topImg;
							// console.log(currentTop, currentTop > baseNum);
							// if (currentTop > baseNum) {
							// 	console.log("第二个");
								let j = Math.ceil(currentTop / baseNum);
								let pageContainer = document.querySelector(
									".pdfViewer .pageContainer" + j
								);
								html.style.top = 0;
								ele.style.top = 0;
								eleImg.style.top =
									currentTop - baseNum * (j - 1) + "px";
								// console.log(
								// 	currentTop,
								// 	top,
								// 	j,
								// 	currentTop - baseNum * (j - 1)
								// );
								pageContainer.appendChild(html);
								promiseArr.push(promise);
								resolve();
							// }
							// else {
							// 	console.log("第一个");
							// 	let pageContainer = document.querySelector(
							// 		".pdfViewer .pageContainer1"
							// 	);
							// 	pageContainer.appendChild(html);
							// 	promiseArr.push(promise);
							// 	resolve();
							// }
						});
					}
				});
			}
			Promise.all(promiseArr).then((res) => {
				this.$nextTick(() => {
					setTimeout(() => {
						this.getPdf();
					}, 500 * length);
				});
			});
		},
		// 生成下载pdf
		getPdf() {
			let that = this;
			//防止截图不全
			document.querySelector(
				".pdfViewer"
			).parentElement.parentElement.scrollTop = 0;
			document.querySelector(
				".pdfViewer"
			).parentElement.parentElement.scrollLeft = 0;
			let parent = document.querySelector(".pdfViewer");
			// 生成图片
			let PDF = new JsPDF("", "pt", "a4");
			let length = parent.children.length;
			for (let i = 0; i < length; i++) {
				// 绘制图片
				html2canvas(parent.children[i]).then(function (canvas) {
					if (parent.children[i].className != "dragImg") {
						let url = canvas.toDataURL();
						let contentWidth = canvas.width;
						let contentHeight = canvas.height;
						let pageHeight = (contentWidth / 592.28) * 841.89;
						let leftHeight = contentHeight;
						let position = 0;
						let imgWidth = 595.28;
						let imgHeight = (592.28 / contentWidth) * contentHeight;
						let pageData = canvas.toDataURL("image/jpeg", 1.0);
						console.log(
							canvas.width,
							canvas.height,
							pageHeight,
							leftHeight,
							imgWidth,
							imgHeight,
							i
						);
						if (i != 0) PDF.addPage();
						if (leftHeight < pageHeight) {
							PDF.addImage(
								pageData,
								"JPEG",
								0,
								0,
								imgWidth,
								imgHeight
							);
						} else {
							if (leftHeight > 0) {
								PDF.addImage(
									pageData,
									"JPEG",
									0,
									position,
									imgWidth,
									imgHeight
								);
								leftHeight -= pageHeight;
								position -= 841.89;
							}
						}
					}
					if (length - 1 == i) {
						setTimeout(() => {
							console.log(
								"总页:",
								length,
								PDF.internal.getNumberOfPages()
							);
							that.loading = false;
							PDF.save(new Date().getTime() + ".pdf");
						}, 1000);
					}
				});
			}
		},
		downloadPdf(blob) {
			const that = this;
			const file = new FileReader();
			file.readAsText(blob, "utf-8");
			file.onload = function () {
				// 判断返回的是数据流还是json对象
				if (that.isJSON(file.result)) {
					// 若返回的是json对象，不进行下载操作
					const jsonData = JSON.parse(file.result);
					this.$message.error(jsonData.message || "下载失败");
					return;
				} else {
					// 若返回的是不是json对象，进行下载操作
					const fileUrl = window.URL.createObjectURL(blob);
					const link = document.createElement("a");
					link.href = fileUrl;
					link.download = "test.pdf";
					document.body.appendChild(link);
					link.click();
					document.body.removeChild(link);
				}
			};
		},
		isJSON(str) {
			if (typeof str == "string") {
				try {
					let obj = JSON.parse(str);
					if (typeof obj == "object" && obj) {
						return true;
					} else {
						return false;
					}
				} catch (e) {
					return false;
				}
			}
		},
		dataURLtoBlob(dataurl) {
			var arr = dataurl.split(",");
			//注意base64的最后面中括号和引号是不转译的
			var _arr = arr[1].substring(0, arr[1].length - 2);
			var mime = arr[0].match(/:(.*?);/)[1],
				bstr = atob(_arr),
				n = bstr.length,
				u8arr = new Uint8Array(n);
			while (n--) {
				u8arr[n] = bstr.charCodeAt(n);
			}
			return new Blob([u8arr], {
				type: mime,
			});
		},

		// * desc: 下载方法
		// * @param url  ：返回数据的blob对象或链接
		// * @param fileName  ：下载后文件名标记
		downloadFile(url, name = "What's the fuvk") {
			console.log("url==", url);
			var a = document.createElement("a");
			a.setAttribute("href", url);
			a.setAttribute("download", name);
			a.setAttribute("target", "_blank");
			let clickEvent = document.createEvent("MouseEvents");
			clickEvent.initEvent("click", true, true);
			a.dispatchEvent(clickEvent);
		},
	},
};
</script>

